import "./App.css";
import Header from "./Header.js";
import Footer from "./Footer.js";
import Box from "./box.js";
const name = "Pravesh Chand";
const time = 2020;

const persons = [
  { name: "Pravesh", title: "CEO", age: "33" },
  { name: "Pravesh", title: "CEO", age: "33" },
  { name: "Pravesh", title: "CEO", age: "33" },
];

function App() {
  return (
    <div className="App">
      <Header />

      <main>
        <Box
          name={persons[0].name}
          title={persons[0].title}
          age={persons[0].age}
        />
      </main>

      <Footer />
    </div>
  );
}

export default App;
